import React from 'react';

const AynextLogo = ({ size = 'w-12 h-12', className = '' }) => {
  return (
    <div className={`${size} ${className} relative`}>
      <img
        src="https://via.placeholder.com/100x100/000000/FFFFFF?text=AYNEXT"
        alt="AYNEXT Logo"
        className="w-full h-full object-contain"
        onError={(e) => {
          // Fallback si l'image n'est pas trouvée
          e.target.style.display = 'none';
          e.target.nextSibling.style.display = 'block';
        }}
      />
      {/* Fallback SVG si l'image n'est pas trouvée */}
      <svg
        viewBox="0 0 100 100"
        className="w-full h-full hidden"
        fill="none"
        xmlns="http://www.w3.org/2000/svg"
      >
        {/* Cercle extérieur incomplet */}
        <path
          d="M50 10 A40 40 0 0 1 90 50 A40 40 0 0 1 50 90 A40 40 0 0 1 10 50 A40 40 0 0 1 50 10"
          stroke="currentColor"
          strokeWidth="8"
          strokeLinecap="round"
          fill="none"
          className="opacity-80"
        />
        
        {/* Lettre A stylisée */}
        <path
          d="M35 75 L50 25 L65 75 M42 60 L58 60"
          stroke="currentColor"
          strokeWidth="6"
          strokeLinecap="round"
          strokeLinejoin="round"
          fill="none"
        />
        
        {/* Effet 3D/bevel sur la lettre A */}
        <path
          d="M35 75 L50 25 L65 75 M42 60 L58 60"
          stroke="currentColor"
          strokeWidth="2"
          strokeLinecap="round"
          strokeLinejoin="round"
          fill="none"
          className="opacity-40"
          transform="translate(1, 1)"
        />
      </svg>
    </div>
  );
};

export default AynextLogo;
